"use strict";
import logo from './IMG_0004.PNG';
import './App.css';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import useSound from "use-sound";
import mySound from './A_resonant_trimmed_2.mp3'; 



function App() {

  const [playSound] = useSound(mySound);

  return (
    <div className="App"> 
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" onClick={playSound}/>
        <p className = "Centering" onClick="https://raymondgifford.com">
          Centering
        </p>
      </header>
    </div>
  );
}

export default App;
